import React from 'react';
import articleContent from './article-content';

const ArticlesList = () => (
    <>
        <h1>Article List</h1>
        {
            articleContent.map(
                (article)=>
            <h1>{article.title}</h1>
            )
        }
        

    </>
);

export default ArticlesList;
